import './Header.css';
import image from './TAHAR.png';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className='header-container'>

      <Link to='/'><img className='header-icon' src={image} alt='LOGO'></img></Link>

      <div class="coupon">
        <p class="coupon-text">Ask about our senior citizen discount!</p>
    </div>

      <div className='header-link-container'>
        <div>
          <h1 className='header-title'>Tahar Garage Door Repair Services</h1>
        </div>
        <div>
          <Link className='header-link' to='/about'>About Us</Link>
          <Link className='header-link' to='/reviews'>Reviews</Link>
          <Link className='header-link' to='/services'>Services</Link>
          <Link className='header-link' to='/gallery'>Gallery</Link>
          <Link className='header-link' to='/faq'>FAQ</Link>
          <Link className='header-link' to='/contact'>Contact</Link>
        </div>
      </div>

      <div className='header-call-button-container'>
        <a className='header-call-button' href='tel:661-202-8255'>Call Now For A Free Quote! 661-202-8255</a>
      </div>

    </div>
  );
};

export default Header;
